import React, { useEffect, useRef } from 'react';
import { motion } from 'framer-motion';
import styled from 'styled-components';
import narasimha from "../../assets/images/narasimha.svg";
import eventifyconnect from "../../assets/images/eventifyconnect.png";

const WorksContainer = styled(motion.div)`
  max-width: 1200px;
  margin: 0 auto;
  padding: 4rem 2rem;
  font-family: 'Poppins', sans-serif;
`;

const Project = styled(motion.div)`
  margin-bottom: 6rem;
  background: #ffffff;
  border-radius: 20px;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  overflow: hidden;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-10px);
    box-shadow: 0 15px 40px rgba(0, 0, 0, 0.2);
  }
`;

const ProjectHeader = styled.div`
  background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
  padding: 2rem;
  color: white;
`;

const CompanyName = styled.h2`
  font-size: 2.5rem;
  margin: 0;
  font-weight: 700;
`;

const Subtitle = styled.p`
  font-size: 1.2rem;
  margin: 0.5rem 0 0;
  opacity: 0.8;
`;

const ContentWrapper = styled.div`
  display: flex;
  padding: 2rem;
  gap: 2rem;

  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const ImageWrapper = styled(motion.div)`
  flex: 1;
  border-radius: 10px;
  overflow: hidden;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);
`;

const ProjectImage = styled.img`
  width: 100%;
  height: auto;
  display: block;
`;

const Description = styled.div`
  flex: 1;
`;

const DescriptionText = styled.p`
  font-size: 1.1rem;
  line-height: 1.6;
  color: #333;
`;

const FeatureList = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const FeatureItem = styled.li`
  margin-bottom: 0.5rem;
  position: relative;
  padding-left: 1.5rem;

  &::before {
    content: '✦';
    position: absolute;
    left: 0;
    color: #2575fc;
  }
`;

const ViewProjectBtn = styled.a`
  display: inline-block;
  margin-top: 1rem;
  padding: 0.8rem 1.5rem;
  background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
  color: white;
  text-decoration: none;
  border-radius: 30px;
  font-weight: 600;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-3px);
    box-shadow: 0 5px 15px rgba(37, 117, 252, 0.4);
  }
`;

const fadeInUpVariants = {
  hidden: { opacity: 0, y: 20 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.6 } }
};

const staggerVariants = {
  hidden: { opacity: 0 },
  visible: {
    opacity: 1,
    transition: {
      staggerChildren: 0.2
    }
  }
};

function Works() {
  return (
    <WorksContainer
      initial="hidden"
      animate="visible"
      variants={staggerVariants}
    >
      <Project variants={fadeInUpVariants}>
        <ProjectHeader>
          <CompanyName>Narasimha Enterprises Hospitality</CompanyName>
          <Subtitle>A comprehensive hospitality management website</Subtitle>
        </ProjectHeader>
        <ContentWrapper>
          <ImageWrapper
            whileHover={{ scale: 1.05 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            <ProjectImage src={narasimha} alt="Narasimha Enterprises Hospitality" />
          </ImageWrapper>
          <Description>
            <DescriptionText>
              Developed a full-featured website for Narasimha Enterprises Hospitality, showcasing their services, team, and clients. The site includes sections for:
            </DescriptionText>
            <FeatureList>
              <FeatureItem>About Us</FeatureItem>
              <FeatureItem>Services</FeatureItem>
              <FeatureItem>Our Team</FeatureItem>
              <FeatureItem>Our Clients</FeatureItem>
              <FeatureItem>Contact Information</FeatureItem>
            </FeatureList>
            <ViewProjectBtn 
              href="https://narasimhaenterpriseshospitality.in/" 
              target="_blank" 
              rel="noopener noreferrer"
            >
              View Project
            </ViewProjectBtn>
          </Description>
        </ContentWrapper>
      </Project>

      <Project variants={fadeInUpVariants}>
        <ProjectHeader>
          <CompanyName>Eventify Connect</CompanyName>
          <Subtitle>An event management platform</Subtitle>
        </ProjectHeader>
        <ContentWrapper>
          <ImageWrapper
            whileHover={{ scale: 1.05 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            <ProjectImage src={eventifyconnect} alt="Eventify Connect" />
          </ImageWrapper>
          <Description>
            <DescriptionText>
              Developed an event management platform for Eventify Connect, providing tools for event planning, management, and execution. The platform includes features such as:
            </DescriptionText>
            <FeatureList>
              <FeatureItem>Event Scheduling</FeatureItem>
              <FeatureItem>Attendee Management</FeatureItem>
              <FeatureItem>Ticketing</FeatureItem>
              <FeatureItem>Analytics</FeatureItem>
              <FeatureItem>Contact Information</FeatureItem>
            </FeatureList>
            <ViewProjectBtn 
              href="https://eventifyconnect.com/" 
              target="_blank" 
              rel="noopener noreferrer"
            >
              View Project
            </ViewProjectBtn>
          </Description>
        </ContentWrapper>
      </Project>
    </WorksContainer>
  );
}

export default Works;
